                               InputStreamReader(System.in));
       msg = br.readLine();
       DatagramPacket data = new DatagramPacket(msg.getBytes(),
        0, msg.length(), group, 1234);
       chat.send(data);
       chat.close();
   }


Jalankan program tersebut.

Program MulticastSniffer menggunakan argument

Buatlah project dengan class MulcastSniffer.
Tuliskan perintah berikut: public class MulticastSniffer {
 public static void main(String[] args) {
 InetAddress group = null;
 int port = 0;
 // read the address from the command line
 try {
 group = InetAddress.getByName(args[0]);
 port = Integer.parseInt(args[1]);
 }
 // end try
 catch (Exception ex) {
 // ArrayIndexOutOfBoundsException, NumberFormatException,
 // or UnknownHostException
 System.err.println(
 "Usage: java MulticastSniffer multicast_address port");
 System.exit(1);
 }
 MulticastSocket ms = null;
 try {
 ms = new MulticastSocket(port);
 ms.joinGroup(group);
 byte[] buffer = new byte[8192];
 while (true) {
 DatagramPacket dp = new DatagramPacket(buffer,
 buffer.length);
 ms.receive(dp);
 String s = new String(dp.getData( ));
 System.out.println(s);
 }
 }
 catch (IOException ex) {
 System.err.println(ex);
 }
 finally {
 if (ms != null) {
 try {
 ms.leaveGroup(group);
 ms.close( );
 }
 catch (IOException ex) {}
 }
 }
 }
 }


Compile project tersebut.

Program MulticastSender menggunakan argument

Buatlah project dengan class MulticastSender.
Tulislah perintah berikut:public class MulticastSender {
public static void main(String[] args) {
  InetAddress ia = null;
  int port = 0;
  byte ttl = (byte) 1;
  // read the address from the command line
  try {
    ia = InetAddress.getByName(args[0]);
    port = Integer.parseInt(args[1]);
    if (args.length > 2) ttl = (byte) Integer.parseInt(args[2]);
  }
  catch (Exception ex)  {
    System.err.println(ex);
    System.err.println(
     "Usage: java MulticastSender multicast_address port ttl");
    System.exit(1);
  }
  byte[] data = "Here's some multicast data\r\n".getBytes( );
